  grids: {
    search: {
      my: 4,
      gap: 3,
    },
  },
  productTitle: {
    mb: 4,
  },
  productPage: {
    container: {
      my: 4,
      mx: 0,
      flexDirection: 'column',
    },
  },

  alerts: {
    signInDanger: {
      color: 'text',
      bg: '#ffe6e6',
      fontSize: '14px',
      fontWeight: 300,
    },
  },
}

