        '&:hover .subcategories': {
          display: 'flex',
          height: 232,
        },

        a: {
          display: 'flex',
          fontSize: '13px',
          margin: 0,
          alignItems: 'center',
          transition: 'all .2s',
          textTransform: 'uppercase',
          color: 'background',
          height: 45,
          px: 3,

          '&:hover': {
            color: 'muted',
            background: '#062f6d',
          },
        },
      },
    },

    ...submenu,
  },
}

